import React from "react";
import CheckoutForm from "../Components/CheckoutForm/CheckoutForm"; 
import './CSS/Checkout.css'
const Checkout = () => {
  return (
    <div className="checkout-container">
 
      <div className="checkout-content">
        <CheckoutForm /> 
      </div>
    </div>
  );
};

export default Checkout;
